B XNF2INF
: XNF to INF Translator

#234567890123456789012345678901234567890123456789012345678901234567890123456
############################################################################
# Tool description (for program help)
############################################################################
M DESCRIPTION
: This program translates the Xilinx XNF files into the OrCAD VST (INF) 
: files which can be simulated using the OrCAD simulation program.[.br][.br]
: USAGE:   xnf2vst xnffile[[.xnf] [[vstfile[[.vst]] [[options][.br][.br]
: EXAMPLE: xnf2vst demo u=true r=true w=true[.br]

############################################################################
# External Parameter Names
# What is this parameter?  This is the...(a short & pithy 1-liner)
############################################################################
M XNFFILE 
: Input XNF file.

M VSTFILE
: Output VST file.

M XACT
: XACT path.

M OL 
: Old library option.

M UD 
: Unit delay option.

M NRF 
: Read existing NRF file.

M OWR 
: Overwrite existing AST and ATR files.

M VERBOSE
: Verbose option.

#234567890123456789012345678901234567890123456789012345678901234567890123456
############################################################################
# Help Messages
# What does this parameter do?  This parameter...(verbose multi-liner)
############################################################################
M HXNFFILE
: Specifies the name of the XNF file to be translated. The file
: extension is optional, if not specified, ".xnf" is assumed. The
: valid file extensions are ".xnf", ".xff", ".xg".

M HVSTFILE
: Specifies the name of the VST file to be written to. This argument
: is optional, if not specified, xnffile is assumed. The file
: extension is optional, if not specified, ".vst" is assumed.

M HXACT
: Specifies the Xilinx XACT path. If this option isn't specified, it
: will be set to the value of the XACT environment variable.

M HOL
: This option must be set to TRUE if you are using the old SDT/VST library
: v4.20 instead of the new unified SDT/VST library from Xilinx.

M HUD
: If this option is set to TRUE, XNF2INF will perform unit-delay 
: translation only (i.e. No DBA file will be created).

M HNRF
: If this option is set to TRUE, XNF2INF will read the existing NRF
: file. XNF2INF always generates a new NRF file regardless of
: this option.

M HOWR
: If this option is set to TRUE, XNF2INF will overwrite the existing
: AST and ATR files using the stimulus and trace information from
: the input XNF file.  If this option is not selected, and an AST
: or ATR file already exist, no new AST or ATR file will be created.

M HVERBOSE
: If this option is TRUE, XNF2INF displays informational messages on the 
: screen and the report file sdt2xnf.log.

